import React from 'react';
import ReactDOM from 'react-dom';
import Cubetemplate from './components/cubes/Cubetemplate';



const GALLERY = [
  {
    img: "1.jpg", title: "Fifty shades of Threta",
    name: "by Navin 'The Flash' Thamindu",
    date: "02/04/2026"
  },
  {
    img: "2.png", title: "Princess cosplay",
    name: "Suchalya Nasaraani",
    date: "05/06/2024"
  },
  {
    img: "3.jpg", title: "Threta theme live performance",
    name: "Tolmojith Bandara",
    date: "07/02/2024"
  },
  {
    img: "4.jpg", title: "3D printing threata action figures",
    desc: "Udukaya Thisanka Niruwath ",
    date: "03/01/2023"
  },
  {
    img: "5.jpg", title: "Fan art of Prince",
    desc: "Disti",
    date: "09/04/2022"
  },
  {
    img: "5.jpg", title: "Threta's mocap artist, Dilan Hewathudella's TEDx speech",
    desc: "Lorem ipsum Lorem ipsum Lorem ipsum Lorem ipsum Lorem ipsum Lorem ipsum Lorem ipsum Lorem ipsum Lorem ipsum",
    date: "09/04/2022"
  },
];

const News = () => (
  <div className="container gal">
        {GALLERY.map(img, title, desc  => (
          <Cubetemplate source={image} />
          
          ))}
  </div>
);

export default News;
